import { container, title } from "../../material-kit-react.js";

const pillsStyle = {
  section: {
    padding: "auto",
  },
  container: {
    marginRight: "200px"

  },
  title: {
    ...title,
    marginLeft: "25px",
    marginTop: "10px",
    minHeight: "10px",
    textDecoration: "none"
  }
};

export default pillsStyle;
